import React from "react";

const DifficultyLevel = props => {
  return (
    <select onChange={props.onChange}>
      <option value="3">Easy</option>
      <option value="6">Medium</option>
      <option value="10">Hard</option>
    </select>
  );
};

export default DifficultyLevel;
